import React,{useState, useEffect} from 'react';
import Axios from "axios";

const MapsTable = () =>  {
    const [mapList, setMapList] = useState([])

useEffect(()=>{
    function tabler(){
    Axios.get('http://localhost:3002/api/get').then((response) =>{
    setMapList(response);
    });
}tabler()
}),[];

  return (
    <div>
        {
            mapList.map((val)=>{
                return <h1>{val.id}</h1>
            })

        }

    </div>
  )
}
export default MapsTable;
